function authenticate(resp){
    return dispatch =>{
        console.log('rrrrrrrrrrrrrrrrrrrrr',resp);
        dispatch({
            type: 'authenticate',
            name: resp.payload.name,
            email: resp.payload.email,
            userId: resp.payload.id,
        })
    }
}

function job(res){
    return dispatch =>{
        console.log(';;;;;;;;;;;;;;;;;;;;',res);
        dispatch({
            type: 'product',
            productId : res.payload.productId,
            vendor: res.payload.vendor,
        })
    }
}

export default {
    authenticate,
    job
}
